  input: "\"TEXT\",\"F3XA\",\"\",\"This report is filed in response to the letter
    from the FEC dated September 12, 2007 requesting clarification on the following
    three items:    1.\tErrors on lines 7, 11(a)(i) and 119(a)(ii), 26, 31, 32, Column.
    B. In March 2007 the committee converted from FEC File to vendor-supported services
    and software from NGP. In the conversion and training process, the year-to-date
    totals for these lines were not appropriately transferred to this report. This
    error is corrected with this filing.  2.\tThe Line 8 calculations were similarly
